Data was cleaned by renaming all variables to adopt the same naming structure (no spaces, no punctuation, etc.). Next, all identifiers were removed from the dataset. Variables containing metadata were removed as they were not vital to the analyses.
After data was cleaned, trait names were extracted from the column names using regular expressions and the columns were then renamed.
Next, all data was arranged so that the trait that was endorsed as a “1” (priority ranking) were isolated. Those traits were then ranked by the frequency in which they occurred. To delineate between effective and ineffective traits, all frequency counts in the ineffective traits were negated.


Code
# Load in packages
library(haven)
library(labelled)
library(tidyverse)
library(janitor)
library(huxtable)
library(broom)
library(ggplot2)
library(skimr)
library(purrr)
library(stringr)
library(forcats)
library(patchwork)
library(ggtext)
library(Rfast)
library(tidytext)
library(wordcloud2)

# Custom Functions
discrete_tab &lt;- function(data,x){
  name &lt;- 
    data |&gt; 
    select({{x}}) |&gt; 
    pull()

  tab &lt;- 
    name |&gt; 
    tabyl() |&gt; 
    select(-(starts_with("val"))) |&gt; 
    # Ignore Error for Now...
    adorn_pct_formatting(,,,percent) |&gt; 
    rename_with(str_to_sentence) |&gt; 
    hux() |&gt; 
    theme_article() |&gt; 
    set_align(everywhere,everywhere,".")

  tab[1,] &lt;- c(str_to_sentence(x),"","")

  tab
}
# Load data
et &lt;- read_sav("Dental+Hygiene+Student+Perceptions+of+Effective+and+Ineffective+Clinical+Teaching+and+Instruction_April+2,+2024_12.43.sav")

# Clean Data
et_cln &lt;- 
  et |&gt; 
  # Clean Names
  clean_names() |&gt; 
  # Only Look at Complete Cases
  filter(finished == 1) |&gt; 
  # Remove identifiers
  select(-consent_form) |&gt; 
  # Select needed columns
  select(!start_date:recorded_date) |&gt;
  select(!recipient_last_name:user_language) |&gt; 
  rename_at(vars(dplyr::ends_with("rank")), ~ paste0("effective_",1:31)) |&gt; 
  rename_at(vars(dplyr::ends_with("rank_0")), ~ paste0("ineffective_", 1:26))

# Get Variable Labels
all_traits &lt;- 
  et_cln |&gt; 
  select(contains("effective")) |&gt; 
  get_variable_labels() 

# Create RegEx Pattern
find_trait &lt;- function(x){
  x &lt;- str_extract(x,"(?&lt;=\\.{3}\\s)(.*)")
  x &lt;- str_extract(x, "(!?-)(.*)(?=-)",group = 2)
  str_trim(x)
}

# Iterate Across Lists
trait_names &lt;- 
  map_df(all_traits,find_trait) |&gt; 
  pivot_longer(cols = effective_1:ineffective_26,
               names_to = "old",
               values_to = "traits")

# Column Names Reflect Traits
# Anchored at Approachable - Not Engaging
all_traits &lt;- 
  et_cln |&gt; 
  select(!contains("group_")) |&gt; 
  select(!contains("comments")) |&gt; 
  rename_at(vars(effective_1:ineffective_26), ~ trait_names$traits)

# Get Names for Effective and Ineffective
tn &lt;- 
  trait_names |&gt; 
  mutate(
    type = ifelse(str_detect(old,"^ef"),
                  "Effective", "Ineffective"),
    type = factor(type, ordered = TRUE)) |&gt; 
  select(-old) 

# Subset Effective and Ineffective Traits
at_cln &lt;- 
  all_traits |&gt; 
  labelled::remove_labels() |&gt; 
  pivot_longer(cols = Approachable:`Not engaging`,
               names_to = "traits",
               values_to = "rating") |&gt; 
  select(traits,rating) |&gt; 
  inner_join(tn, by = join_by(traits)) |&gt; 
  group_by(traits,rating)

# Get Top Ranking Value of Each Trait and Rank
at_cln_sort &lt;- 
  at_cln |&gt; 
  filter(rating == 1) |&gt; 
  add_count(sort = TRUE) |&gt; 
  ungroup() |&gt; 
  mutate(
    ranking = rank(n,ties.method = "first"),
    shift = ifelse(type == "Effective", n, -n)
  ) |&gt; 
  group_by(type,traits,shift) |&gt; 
  count() |&gt; 
  ungroup() |&gt;
  # Remove to Get All Data
  top_n(20)
